import Cards from "../commons/Cards"
import {useParams} from 'react-router'

console.log()
const Grids= (props) => {
    const {type}= useParams()
    const auxi = props[type]
    return  (<div className="cards">
          {auxi.map(data=>{
              return  <div key={data.id}>             
              <Cards data={data}/>
                 </div>
          })}
    </div>)
}

export default Grids
